import React, { Component } from 'react'

export default class ListContact extends Component {
    render() {
        console.log(this.props);
        return (
            <ol>
                {this.props.contacts.map( contact => {
                    return (
                        <div key={contact.id}>contact.name</div>
                    )
                })} 
            </ol>
        )
    }
}
